(1, 0, 0, 'Các con đường lĩnh hội tri thức có Liên đới hay Tách biệt', 'Mostly Separate Knowing,Tách rời và được kết nối,Mostly Connected Knowing', 'Thang dựa trên thuyết nhận thức riêng rẽ và kết nối. Thuyết này mô tả hai cách khác nhau chúng ta có thể đánh giá và học những thứ mà chúng ta thấy và nghe.<ul><li><strong>Những người nhận thức riêng rẽ</strong> giữ được sự khách quan mà không quan tâm cảm xúc. Khi thảo luận với người khác, họ thích giữ ý kiến riêng của mình, dùng lý luận để tìm các lỗ hổng trong các ý tưởng của đối phương.</li><li>strong>Những người nhận thức kết nối</strong> thì nhạy cảm hơn với người khác. Họ giỏi ở việc thông cảm và có xu hướng lắng nghe và hỏi cho đến khi họ cảm thấy có thể kết nối và \"hiểu các thứ theo quan điểm của họ\". Họ học bằng cách cố gắng chia sẻ kinh nghiệm dẫn đến kiến thức mà họ tìm được từ người khác.</li></ul>', 0, 1691503026),
(2, 0, 0, 'Thang điểm mặc định khả năng làm tốt', 'Chưa thật thành thạo,Thành thạo', 'Thang đánh giá tự động không cung cấp gì ngoài việc mô tả một ai đó có thành thạo hay không', 0, 1691503026);

